function this.Reload()
    --Use vanilla tables
    this.MbmCommonSetting20BaseResSecTable = {}
    this.MbmCommonSetting20BaseResSecTable = this.GetTable()
    --Load mods
    if ZetaIndex ~= nil then
        ZetaIndex.SafeLoadAllModFiles()
        ZetaIndex.ModFunction("SetMbmCommonSetting20BaseResSec", this ) --Passthrough
        local newSettingTable = ZetaIndex.ModGet("MbmCommonSetting20BaseResSec", this)
        if newSettingTable ~= nil and next(newSettingTable) then
            local indexIDs = {
                resourceParams = "resource", 
                gimmickParams = "gimmickName", 
                rankLines = "sectionFuncId", 
                containerProcessingParams = "sectionFuncRank",  
                diamondGMPs = true,
                autoGmp = true,
                containerProcessingBasicParams = true,
                medicalSectionFuncTreatmentParams = true,
                baseDevSectionFuncPlatformExtentionParams = true,
                extractingTimeMinute = true,
            }
            this.MbmCommonSetting20BaseResSecTable = ZetaUtil.MergeParams(this.MbmCommonSetting20BaseResSecTable, newSettingTable, true, indexIDs)
        end
    end
    for i,buildParam in ipairs(this.MbmCommonSetting20BaseResSecTable.buildParams)do
        if buildParam.category ~= nil then --If it contains a category, it's for sections
            TppMotherBaseManagement.RegisterSectionClusterBuildParam(buildParam)
        else TppMotherBaseManagement.RegisterCommandClusterBuildParam(buildParam) end
    end
    TppMotherBaseManagement.SetSmallDiamondGmp{gmp=this.MbmCommonSetting20BaseResSecTable.diamondGMPs.small}
    TppMotherBaseManagement.SetLargeDiamondGmp{gmp=this.MbmCommonSetting20BaseResSecTable.diamondGMPs.large}
    TppMotherBaseManagement.RegisterResourceBaseExtractingTimeMinute{timeMinute=this.MbmCommonSetting20BaseResSecTable.extractingTimeMinute}
    TppMotherBaseManagement.RegisterContainerParam(this.MbmCommonSetting20BaseResSecTable.containerParams)
    for i,resourceParam in ipairs(this.MbmCommonSetting20BaseResSecTable.resourceParams)do TppMotherBaseManagement.RegisterResourceParam(resourceParam) end
    for i,gimmickParam in ipairs(this.MbmCommonSetting20BaseResSecTable.gimmickParams)do TppMotherBaseManagement.RegisterStageGimmickParam(gimmickParam) end
    for i,rankLine in ipairs(this.MbmCommonSetting20BaseResSecTable.rankLines)do TppMotherBaseManagement.RegisterSectionFuncRankLines(rankLine) end
    TppMotherBaseManagement.RegisterCombatSectionFuncAutoGmp(this.MbmCommonSetting20BaseResSecTable.autoGmp)
    for i,autoResourceParam in ipairs(this.MbmCommonSetting20BaseResSecTable.autoResourceParams)do TppMotherBaseManagement.RegisterAutoResourceParam(autoResourceParam) end
    for i,containerProcessingParam in ipairs(this.MbmCommonSetting20BaseResSecTable.containerProcessingParams)do TppMotherBaseManagement.RegisterContainerProcessingParam(containerProcessingParam) end
    TppMotherBaseManagement.RegisterContainerProcessingBasicParam(this.MbmCommonSetting20BaseResSecTable.containerProcessingBasicParams)
    TppMotherBaseManagement.RegisterMedicalSectionFuncTreatmentParam(this.MbmCommonSetting20BaseResSecTable.medicalSectionFuncTreatmentParams)
    TppMotherBaseManagement.RegisterBaseDevSectionFuncPlatformExtentionParam(this.MbmCommonSetting20BaseResSecTable.baseDevSectionFuncPlatformExtentionParams)
end

return this